import { StyleSheet} from 'react-native';

const infoPageStyles = StyleSheet.create({
    container: {
        flex: 1,
        alignItems: 'center',
        justifyContent: 'center',
    },
    title: {
        fontSize: 20,
        fontWeight: 'bold',
    },
    separator: {
        marginVertical: 30,
        height: 1,
        width: '80%',
      }, 
      getStartedContainer: {
        alignItems: 'center',
        marginHorizontal: 50,
      },
      homeScreenFilename: {
        marginVertical: 7,
      },
      codeHighlightContainer: {
        borderRadius: 3,
        paddingHorizontal: 4,
      },
      getStartedText: {
        fontSize: 17,
        lineHeight: 24,
        marginTop:15,
        textAlign: 'justify',
      },
      helpContainer: {
        marginTop: 15,
        marginHorizontal: 20,
        alignItems: 'center',
      },
      helpLink: {
        paddingVertical: 15,
      },
      helpLinkText: {
        textAlign: 'center',
      },
    });
export {infoPageStyles};
